/**
 * Union type of all valid translation keys.
 * Keys can be used with or without namespace prefix.
 * When used without prefix, the key must exist in at least one namespace.
 * Examples:
 *   - 'common:status.pending' (explicit namespace)
 *   - 'auth:login.email' (explicit namespace)
 *   - 'status.pending' (works if common namespace is used)
 */
export type TranslationKey =
  | `auth:${AuthKeys}`
  | `ceph:${CephKeys}`
  | `common:${CommonKeys}`
  | `functions:${FunctionsKeys}`
  | `machines:${MachinesKeys}`
  | `organization:${OrganizationKeys}`
  | `queue:${QueueKeys}`
  | `resources:${ResourcesKeys}`
  | `settings:${SettingsKeys}`
  | `shared:${SharedKeys}`
  | `storageProviders:${StorageProvidersKeys}`
  | `system:${SystemKeys}`
  // Allow keys without namespace prefix (for when namespace is contextually known)
  | AuthKeys
  | CephKeys
  | CommonKeys
  | FunctionsKeys
  | MachinesKeys
  | OrganizationKeys
  | QueueKeys
  | ResourcesKeys
  | SettingsKeys
  | SharedKeys
  | StorageProvidersKeys
  | SystemKeys;

/**
 * List of all translation namespaces
 */
export const TRANSLATION_NAMESPACES = ['auth', 'ceph', 'common', 'functions', 'machines', 'organization', 'queue', 'resources', 'settings', 'shared', 'storageProviders', 'system'] as const;

export type TranslationNamespace = typeof TRANSLATION_NAMESPACES[number];
